import { useParams } from "react-router-dom"
import { useContext } from 'react'
import Context from '../components/Context'

export default function ClubDetails() {
    const userData = useContext(Context)
    const params = useParams()
    let clubData = null

    switch (params.id) {
        case "1":
            clubData = {
                name: 'Public Health Advocate',
                image: '../img/club1.png',
                major: 'All',
                description: 'Founded in 2005, the Public Health Advocate (PHA) is an undergraduate publication featuring current public health issues with local, national, and international perspectives. It is the nation\'s first undergraduate public health publication. The Public Health Advocate is dedicated to giving students interested in health the opportunity for their work to be published in our print issue or our online platform. Print issues are made available to the campus community each semester, and our online platform is updated regularly with articles.\n'
            }
            break

        case "2":
            clubData = {
                name: 'Coffee Mug',
                price: 25.00,
                image: 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/Cat_August_2010-4.jpg/1200px-Cat_August_2010-4.jpg'
            }
            break

        default:
            break
    }

    return (
        <>
            <h1>{clubData.name}</h1>
            {
                clubData != null ?
                <>
                    <img src={clubData.image} alt={clubData.name} width="400" />
                    <h2>About Us</h2>
                    <p>Relevant Majors: {clubData.major}</p>
                </>
                : ''
            }
        </>
    )
}
